vec2 mainSound( in int samp, float time )
{
    float a[] = float[](14.01, 111.1,0.5,0.1,2.012,67.0,1.0,5.5);
    float f = step(cos(time*13.37),0.5);
    float k = 10.0;
    float g = a[int(time*k) % a.length()];
    float c = sin(time*20.15)/g;
    float d = floor(sin(c*1.2)) * cos(.133+c*2.53)*0.5;
    float s = step(sin(time*25.1),0.5);
    return vec2(d+s*1.0);
}
